tances[$instanceIndex]=$instance;}return self::$instances[$instanceIndex];}protected static function getDb($connectionIndex=-1){if($connectionIndex==-1)$connectionIndex=static::$connectionIndex;if(!isset(static::$connections[$connectionIndex])){$cfg=static::getCfg($connectionIndex);$connection=NULL;if($cfg->driver=='mysql'){$options=array();if(defined('PDO::MYSQL_ATTR_MULTI_STATEMENTS'))$options[PDO::MYSQL_ATTR_MULTI_STATEMENTS]=TRUE;if(defined('PDO::MYSQL_ATTR_INIT_COMMAND'))$options[PDO::MYSQL_ATTR_INIT_COMMAND]="SET NAMES 'UTF8'";$connection=new PDO("mysql:host={$cfg->server};dbname={$cfg->dbname}",$cfg->username,$cfg->password,$options);}else if($cfg->driver=='mssql'){$connection=new PDO("sqlsrv:Server={$cfg->server};Database={$cfg->dbname}",$cfg->username,$cfg->password);}else if($cfg->driver=='sqllite'){$appRoot=MvcCore::GetRequest()->appRoot;if(strpos($appRoot,'phar://')!==FALSE){$lastSlashPos=strrpos($appRoot,'/');$appRoot=substr($appRoot,7,$lastSlashPos-7);}$fullPath=realpath($appRoot.$cfg->path);$connection=new PDO("sqlite:$fullPath");}static::$connections[$connectionIndex]=$connection;}return static::$connections[$connectionIndex];}protected static function getCfg($connectionIndex=-1){if($connectionIndex==-1)$connectionIndex=self::$connectionIndex;if(!isset(self::$configs[$connectionIndex])){$cfg=App_Bootstrap::GetConfig();self::$configs[$connectionIndex]=(object)$cfg->db[$connectionIndex];}return self::$configs[$connectionIndex];}protected static function getResource($args=array(),$modelClassName='',$resourceClassPath='_Resource'){$result=NULL;if(!$modelClassName)$modelClassName=get_called_class();if(strpos($modelClassName,'_Resource')===FALSE){$resourceClassName=$modelClassName.$resourceClassPath;if(class_exists($resourceClassName)){$result=call_user_func_array(array($resourceClassName,'GetInstance'),$args);}}return$result;}public function __set($name,$value){$this->$name=$value;}public function __get($name){return(isset($this->$name))?$this->$name:null