		";$select=$this->db->prepare($sql);$select->execute(array(':id_questionnaire'=>$this->idQuestionnaire,':id_question'=>$this->idQuestion,));return intval($select->fetchColumn());}public function LoadAllQuestionnairePersonsCount(){$executedTable=self::TABLE_EXECUTED;$personsTable=self::TABLE_PERSONS;$sql="
