class SimpleForm_Validators_CompanyTaxId extends SimpleForm_Validators_CompanyIds{protected static$exceptionMessage="No company TAX ID verification method for language: '{lang}'.";protected static$errorMessageKey=SimpleForm::TAX_ID;protected function validate_CS($id=''){$id=preg_replace('#\s+#','',$id);if(!preg_match('#^\d{8}$#',$id)){return FALSE;}$a=0;for($i=0;$i<7;$i++){$a+=$id[$i]*(8-$i);}$a=$a% 11;if($a===0)$c=1;elseif($a===10)$c=1;elseif($a===1)$c=0;else$c=11-$a;return(int)$id[7]===$c;}}
class SimpleForm_Validators_CompanyVatId extends SimpleForm_Validators_CompanyTaxId{protected static$exceptionMessage="No company VAT ID verification method for language: '{lang}'.";protected static$errorMessageKey=SimpleForm::VAT_ID;protected function validate_CS($id=''){$id=preg_replace('#\s+#','',$id);if(substr($id,0,2)=='CZ'){$id=substr($id,2);return parent::validate_CS($id);}else{return FALSE;}}}
class SimpleForm_Validators_MaxSelectedOptions extends SimpleForm_Validators_ValueInOptions{public function Validate($submitValue,$fieldName,SimpleForm_Core_Field&$field){$safeValue=is_array($submitValue)?$submitValue:array();$safeValueCount=count($safeValue);if($field->MaxSelectedOptionsCount>0&&$safeValueCount>$field->MaxSelectedOptionsCount){$this->addErrorMsg(SimpleForm::$DefaultMessages[SimpleForm::CHOOSE_MAX_OPTS],$fieldName,$field,array($field->MaxSelectedOptionsCount));}return$safeValue;}}
class SimpleForm_Validators_MinSelectedOptions extends SimpleForm_Validators_ValueInOptions{public function Validate($submitValue,$fieldName,SimpleForm_Core_Field&$field){$safeValue=is_array($submitValue)?$submitValue:array();$safeValueCount=count($safeValue);if($field->MinSelectedOptionsCount>0&&$safeValueCount<$field->MinSelectedOptionsCount){$this->addErrorMsg(SimpleForm::$DefaultMessages[SimpleForm::CHOOSE_MIN_OPTS],$fieldName,$field,array($field->MinSelectedOptionsCount));}return$safeValue;}}
